import React, { Component } from 'react';
import '../../assets/css/ControlCenter/Tab.scss';
import TabBtn from "./TabBtn";

class Tab extends Component {

    render() {
        return(
            <div className="tab">
                <TabBtn btnName="Style"/>
                <TabBtn btnName="Export"/>
            </div>
        )
    }
}

export default Tab;
